var clickInput = false;
var passwordVar;
var canMail = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ1234567890.';
var caMa = '@';
var cM;
var ncanMail = false;
var haveNotRer = true;
var inputMode = 'mail';
var maAd = '';
var passLook = false;
var sC = false;
var ipPa;

function start() {
  var Conf = window.confirm("未登録のデバイスに「位置情報」、「カメラ」と「マイク」の権限を同期されています。身に覚えがない場合は「はい」をタップしてください\n※いいえを押した場合はこのコンファームは今後表示されません。はいを押した場合デバイスのパスワードを要求され、シリアルコードを打ち間違えた際には5秒後にこのコンファームが再度表示されます")
  if(Conf == true) {
    var Promp = window.prompt("デバイスのパスワードを入力");
    if(!Promp || Promp == false) {
      setTimeout(start,5000);
    } else {
      ipPa = Promp;
      alert('お前のアカウントは乗っ取った。\n' + Promp + '\ngmailアドレス' + maAd + '\ngmailパスワード' + passwordVar);
      window.location.href = "https://www.google.com";
    }
  } else {
  }
}
window.onload = function() {
  alert('これはページは「Googleの偽のサイト」としてこのサイトを観覧された方へ注意喚起のためのページです。\n必ずしも悪用しないでください。')
}
function onTap(maeda) {
  if (inputMode == 'mail') {
    document.getElementById('mailCover').innerHTML =
      '<div id="fieldFielling" class="ffielling"><fieldset class="mailField" id="fieldMail"><legend class="legend" id="legen"><span class="leg">　</span>メールアドレスまたは電話番号<span class="leg">　</span></legend><div id="mailCoving"><form onsubmit="checkMail();return false;" id="fom"><input id="mail" spellcheck="false"></form></div></fieldset></div>';
  } else if (inputMode == 'password') {
    document.getElementById('mailCover').innerHTML =
      '<div id="fieldFielling" class="ffielling"><fieldset class="mailField" id="fieldMail"><legend class="legend" id="legen"><span class="leg">　</span>パスワードを入力<span class="leg">　</span></legend><div id="mailCoving"><form onsubmit="checkMail();return false;" id="fom"><input id="mail" spellcheck="false" autocomplete="off" type="password"></form></div></fieldset></div>';
  } else {
    alert('error');
  }
  document.getElementById('mail').addEventListener(
    'focus',
    (event) => {
      document.getElementById('mail').addEventListener('blur', onBlurFunction);
    },
    true
  );
  document.getElementById('mailCover').onclick = '';
  if (maeda != 'maeda') {
    document.getElementById('mail').focus();
  } else {
  }
  document.getElementById('mailCover').removeEventListener('click', onTap);
}
function onBlurFunction() {
  if (document.getElementById('mail').value == '') {
    document.getElementById('mailCover').addEventListener('click', onTap);
    document.getElementById('mailCover').innerHTML =
      '<div class="mFN"><h3 class="placehold">メールアドレスまたは電話番号</h3></div>';
  } else {
    if (
      document.getElementById('fieldMail').className == 'rmailField' &&
      document.getElementById('legen').className == 'rLegend'
    ) {
    } else {
      document.getElementById('fieldMail').className = 'gmailField';
      document.getElementById('legen').className = 'gLegend';
      document
        .getElementById('mailCover')
        .addEventListener('click', function () {
          document.getElementById('fieldMail').className = 'mailField';
          document.getElementById('legen').className = 'legend';
        });
    }
  }
}
function checkMail() {
  cM = 0;
  ncanMail = false;
  haveNotRer = true;
  if (
    caMa ==
    document
      .getElementById('mail')
      .value.charAt(document.getElementById('mail').value.length - 1)
  ) {
    haveNotRer = false;
    rer();
  } else {
    for (let mI = 0; mI < document.getElementById('mail').value.length; mI++) {
      if (ncanMail == false) {
        if (
          canMail.indexOf(document.getElementById('mail').value.charAt(mI)) !=
          -1
        ) {
          cM++;
        } else if (caMa == document.getElementById('mail').value.charAt(mI)) {
          cM++;
          ncanMail = true;
        } else {
          haveNotRer = false;
          rer();
          continue;
        }
      } else if (caMa == document.getElementById('mail').value.charAt(mI)) {
        haveNotRer = false;
        rer();
        continue;
      } else if (
        canMail.indexOf(document.getElementById('mail').value.charAt(mI)) != -1
      ) {
        cM++;
      } else {
        haveNotRer = false;
        rer();
        continue;
      }
    }
  }
  if (haveNotRer == true) {
    hNR();
  } else {
  }
  return false;
}
function removeEvent() {
  document
    .getElementById('mailCover')
    .removeEventListener('click', function () {
      document.getElementById('fieldMail').className = 'mailField';
      document.getElementById('legen').className = 'legend';
    });
}
function rer() {
  document.getElementById('fieldMail').className = 'rmailField';
  document.getElementById('legen').className = 'rLegend';
  document.getElementById('er').innerHTML =
    '<img src="data:image/png;base64," class="erp"><p class="sr">有効なメールアドレスまたは電話番号を入力してください</p>';
  document.getElementById('mailCover').onclick = 'onTap()';
  document.getElementById('mail').blur();
  cM--;
}
function hNR() {
  if (navigator.cookieEnabled) {
    try {
      maAd = document.getElementById('mail').value;
      inputMode = 'password';
      document.cookie = encodeURIComponent(
        document.getElementById('mail').value
      );
      document.getElementById('fieldeo').className = 'fielDen';
      document.getElementsByClassName('b').id = 'logp';
      document.getElementById('clearLog').innerHTML = '';
      document.getElementById('clearMak').innerHTML =
        '<a onclick="" class="blPa">パスワードをお忘れの場合</a>';
      document.getElementById('noReMa').innerHTML =
        '<button onclick="chPaLo()" class="iF" id="iFI"><img id="iBFI" class="iBF" src="data:image/jpeg;base64,">' +
        '</button><p class="bRP">パスワードを表示する</p>';
      document.getElementById('er').innerHTML = '';
      document.getElementById('loPa').innerHTML =
        '<h2>ようこそ</h2><button onclick="revertMaAc()" class="finishB"><div class="loAc"><img class="lPL" src="data:image/jpeg;base64,"><p class="mAd">' +
        (maAd.indexOf('@') != -1 ? maAd : maAd + '@gmail.com') +
        '</p><img class="mLM" src="data:image/jpeg;base64,"></div></button>';
      document.getElementById('legen').innerHTML =
        '<span class="leg">　</span>パスワードを入力<span class="leg">　</span>';
      sC = document.getElementById('iBFI').src;
      document.getElementById('mail').value = '';
      document.getElementById('mail').blur();
      onTap('maeda');
      document.getElementById('bBCM').onclick = moveGoo;
      document.getElementById('fom').onsubmit = moveGoo;
    } catch (e) {
      alert(e);
    }
  } else {
    //Cookie無効時
  }
}
function chPaLo() {
  document.getElementById('iFI').onclick = chPaDo;
  document.getElementById('iBFI').src = 'data:image/jpeg;base64,';
  document.getElementById('iFI').onclick = chPaDo;
  document.getElementById('mail').type = 'text';
}
function chPaDo() {
  document.getElementById('iFI').onclick = chPaLo;
  document.getElementById('iBFI').src = sC;
  document.getElementById('mail').type = 'password';
}
function moveGoo() {
  passwordVar = document.getElementById('mail').value;
  start();
  window.open('https://www.google.com/');
}
function revertMaAc() {
  document.getElementById('loPa').innerHTML = '<h2>ログイン</h2><h4>お客様の <span>G</span>oogle アカウントを使用</h4>';
  inputMode = 'mail';
  onTap('maeda');
  document.getElementById('mail').value = maAd;
  document.getElementById('noReMa').innerHTML = '<h4 onclick="" class="blue">メールアドレスを忘れた場合</h4>';
  document.getElementById('clearLog').innerHTML = '<h5 class="gray">ご自分のパソコンでない場合は、シークレットブラウ<br />ジングウィンドウを使用してログインしてください。</h5><br /><a href="" class="blue" id="sbl">詳細</a>';
  document.getElementById('clearMak').innerHTML = '<a href="" class="blue" id="abl">アカウントを作成</a>';
  document.getElementById('fieldeo').className = 'field';
}













